import React from 'react'
import "../styles/PostSender.css"
import Avatar from "@material-ui/core/Avatar";

const PostSender = () => {
    return (
        <div className="postsender">
            
            <div className="postsender__content">
                <Avatar/>
            </div>
            
        </div>
    )
}

export default PostSender
